  "presets": [
    [
      "@docusaurus/preset-classic",
      {
        "docs": {
          "homePageId": "doc1",
          "sidebarPath": "/Users/chubimauk/Desktop/React Projects/mangaxmanga-website/mangaxmanga/sidebars.js",
          "editUrl": "https://github.com/facebook/docusaurus/edit/master/website/"
        },
        "blog": {
          "showReadingTime": true,
          "editUrl": "https://github.com/facebook/docusaurus/edit/master/website/blog/"
        },
        "theme": {
          "customCss": "/Users/chubimauk/Desktop/React Projects/mangaxmanga-website/mangaxmanga/src/css/custom.css"
        }
      }
    ]
